import React, { useState, useEffect } from "react";
import DefaultNav from "../components/DefaultNav";
import Sidebar from "../components/Sidebar";

const MangaList = () => {
  const [user, setUser] = useState({});

  useEffect(() => {}, []);

  return (
    <>
      <DefaultNav />
      <Sidebar user={user} />
    </>
  );
};

export default MangaList;
